import React from 'react';
import {
    InputGroup,
    InputGroupAddon,
    Input,
    Button
} from 'reactstrap';

const Example = (props) => {
    return (
        <div>
            <InputGroup>
                <Input placeholder="Salon de coiffure" />
                <Input placeholder="mail.com" />
                <InputGroupAddon addonType="append">@</InputGroupAddon>
            </InputGroup>
            <br />
            <InputGroup>
                <Input type="password" placeholder="password" />
            </InputGroup>

            <br />
            <Button outline color="primary">Connect</Button>
        </div>
    );
};

export default Example;
